import r1 from "../src/images/r1.jpg";
import r6 from "../src/images/r3.png";
import r4 from "../src/images/r5.png";
import r5 from "../src/images/r4.jpg";
import r2 from "../src/images/r2.jpg";

const Sdata=[
    {imgsan:r1,titlesan:"Image1",btnsan:"Click me"},
    {imgsan:r2,titlesan:"Image2",btnsan:"Click here"},
    {imgsan:r3,titlesan:"Image3",btnsan:"Go somewhere"},
    {imgsan:r4,titlesan:"Image4",btnsan:"Get started"},
    {imgsan:r5,titlesan:"Image5",btnsan:"Let's start"},
    {imgsan:r6,titlesan:"Image6",btnsan:"Let's go"}
];
export default Sdata;
